import React from "react";
import { login } from "../assets";
const LoginPage = () => {
  return (
    <div className="h-screen flex items-start">
      <div className="relative w-[50%] h-[100%] flex flex-col">
        <div className="absolute top-[25px] left-[10%] flex flex-col">
          <h1 className="text-4xl text-white font-extrabold my-4"></h1>
        </div>
        <img src={login} className="w-full h-full object-cover" />
      </div>
    </div>
  );
};

export default LoginPage;
